import './ExpenseItem.css'

function ExpenseItem(props) {
    return (
        <div className='expense-card'>
            <div className='expense-card__date'><p>{props.date.toISOString()}</p></div>
            <div className='expense-card__product'><h3>Pizza Margherita</h3></div>
            <div className='expense-card__price'><h3>7.95$</h3></div>
        </div>
    )
}

export default ExpenseItem;
